css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("facebook.com") {
body {background-color : #FFFFFF ;background-image : url(http://img11.imageshack.us/img11/3505/ca1i.jpg) ;background-repeat : no-repeat ;background-attachment : fixed ;background-position : center center ;}
.usercontent {color : #FF0000 ;font-family : default ;text-transform : default ;}
.usercontent a, .usercontent a:link, .usercontent a:visited, .usercontent a:hover, .usercontent a:active {color : #B90003 ;}
.usercontent a:hover {color : #FF5F5F ;}
.commonbox {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : default ;}
.commonbox h1, .commonbox h2 {color : #FF0000 ;font-family : default ;text-transform : default ;background-color : #FFFFFF ;}
.commonbox .viewall {color : #FFA9A9 ;font-family : default ;text-transform : default ;}
.commonbox .imgblock75, .ir {background-color : #FF0000 ;border-color : #FFFFFF ;border-width : 2px ;border-style : solid ;}
.commonbox .dr {color : #FF0000 ;font-family : default ;text-transform : default ;background-color : #FFFFFF ;}
.commonbox .evenrow {background-color : #FF3333 ;}
.controlpanel {}
.photos {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.friends {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.blogsreviews {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.videos {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.testimonialscomments {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.moreabout {}
.fanof {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.groups {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.testimonials {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.scrapbook {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.myfans {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.reviews {background-color : #FFFFFF ;border-color : #FF0000 ;}
.blogs {background-color : #FFFFFF ;border-color : #FF0000 ;border-width : 2px ;border-style : dotted ;}
.controlpanel .imgblock200 {}
.data {color : #FF0000 ;font-family : default ;text-transform : default ;}
.controlpanel .q {color : #FF0000 ;font-family : default ;text-transform : default ;}
.data a {color : #FF0000 ;font-family : default ;text-transform : default ;}
a.more {color : #FF0000 ;font-family : default ;text-transform : default ;}
#controlPanelButtons a, #controlPanelButtons a:link, #controlPanelButtons a:visited {}
#controlPanelButtons a:hover {}

}
